import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import HomePage from './App';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Abouts from './About';
import Search from './Search';
import Getcatalog from './GetCatalog';
import PammelGrocery from './Pammel';
import AddItemPammel from './AddItemPammel';
import Hyvee_West from './Hyvee_West';
import AddItemHyvee_West from './AddItemHyvee_West';
import Hyvee_Lincoln from './Hyvee_Lincoln';
import AddItemHyvee_Lincoln from './AddItemHyVee_Lincoln';
import Unimart from './Unimart';
import AddItemUnimart from './AddItemUnimart';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
   <BrowserRouter>
   <Routes>



    <Route
    path ="/" 
    element={<HomePage/>}
    />
    <Route
    path ="/About"
    element={<Abouts/>}
    />
    <Route
    path ="/Search"
    element={<Search/>}
    />
    <Route
    path ="/GetCatalog"
    element={<Getcatalog/>}
    />
    <Route
    path ="/Pammel"
    element={<PammelGrocery/>}
    />
 <Route
  path ="/Hyvee_West"
  element={<Hyvee_West/>}


  />

  <Route
  path ="/Hyvee_Lincoln"
  element={<Hyvee_Lincoln/>}


  />

  <Route
  path ="/Unimart"
  element={<Unimart/>}
 />

 <Route
    path ="/AddItemPammel"
    element={<AddItemPammel/>}
    />

<Route
    path ="/AddItemHyvee_West"
    element={<AddItemHyvee_West/>}
    />
    <Route
    path ="/AddItemUnimart"
    element={<AddItemUnimart/>}
    />
    <Route
    path ="/AddItemHyvee_Lincoln"
    element={<AddItemHyvee_Lincoln/>}
    />



   </Routes>

   </BrowserRouter>

  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
